import "./App.css"

import { BrowserRouter as Router,Routes,Route,Link} from "react-router-dom";
function RRoute(){
    return(
        <div>
          <Router>
          <Routes>
          <Route path='/' element="Home" />
        

          <ul>
                <li>HOME</li>
                <li>ABOUT</li>
                <li>CONTACT</li>
             </ul>
             </Routes>
          </Router>

        </div>
    )
}
export default RRoute;
